ccount_refresh:"刷新",account_bet_date:"日期",account_bet_winnings:"获胜",account_bet_color:"颜色",account_duel_date:"日期",account_duel_winnings:"获胜",account_duel_color:"颜色",transfer_title:"发送",transfer_deposit_subtitle:"存入",transfer_button:"发送",rewards_title:"奖励",rewards_verify_description:"请验证您的账号以证明您不是机器人. <br/><br/>您必须拥有<span class='redtext'>CS:GO</span> 并且您的Steam个人资料必须设置为 <span class='redtext'>公开</span>.<br/>(您可以在验证结束后重新设置为私密)<br/>",rewards_verify_button:"验证账户",rewards_description:"获取你的每日奖励！提升等级来获取更多奖励！<br/>推荐你的朋友来获得更多免费的Bux！",rewards_referral_subtitle:"推荐码已被激活",rewards_referral_description:"兑换",rewards_referral_claim:"兑换",rewards_referral_claimed:"已兑换",rewards_reward_subtitle:"每日奖励",rewards_reward_claim:"兑换",rewards_reward_claimed:"已兑换",rewards_group_subtitle:"加入Steam讨论组",rewards_group_description:"成为我们的一员！",rewards_group_claim:"兑换",rewards_note:"*提升等级以获得更多的每日奖励",rewards_redeem_description:"兑换一个推荐码 (得到 <span class='redtext'>1,000</span> Bux):",rewards_redeem_button:"兑换",rewards_referral_code_description:"分享你的兑换码 (每送出 <span class='redtext'>1,000</span> Bux, 得到 <span class='redtext'>50</span> Bux):",rewards_referral_code_button:"更新",faq_title:"FAQ常见问题解答",faq_provably_question:"什么是可验证公平？",faq_provably_answer:"<p>可验证公平表明了随机性和结果在投注阶段之前就已经生成完毕。这个结果在任何情况下都无法被改变。<br />\n因此可以证明网站或管理员在投注开始后无法改变轮盘结果。</p>\n\n<p>为了证明每一轮的公平性，我们使用如下的公式：</p>\n<p><i>SHA256(Salt + Random) = Hash</i></p>\n\n<pre>举例:\n\n哈希值: e66462d3c7baf608af84d1b3e2b2e0b25fad030eb04de4757e627812be79dfa0\n盐: 2c2d9fa7bf4b037640067f102c0c8707\n随机: 31\n输入: 2c2d9fa7bf4b037640067f102c0c870731\n输出: e66462d3c7baf608af84d1b3e2b2e0b25fad030eb04de4757e627812be79dfa0\n哈希值和输出完全一样，因此这一轮的结果可验证公平。</pre>\n\n<p>您可以利用任何SHA256哈希计算器自行验证，例如{faq_provably_link}</p>",faq_chat_question:"为什么我不能聊天",faq_chat_answer:"我们需要您达到至少10级才能聊天，该举措是为了防止广告和滥用。",faq_level_question:"我该如何提升等级？",faq_level_answer:"在主轮盘每累计投注50000Bux即可提升1级<br/>您的等级越高，每日奖励的额度也就越高。",faq_referral_question:"每推荐成功1人我能得到多少Bux？",faq_referral_answer:"您将得到50Bux, 被推荐人会收到1000Bux",faq_location_qu